import React from "react";
import ReactDOM from "react-dom";
import Highcharts, { color } from 'highcharts';
import HighchartsReact from "highcharts-react-official";
import HighChartsMore from "highcharts/highcharts-more";
import item from "highcharts/modules/item-series"
function SoftChart() {
    HighChartsMore(Highcharts)
    item(Highcharts)
    let options= {
        legend: {
            enabled:false
        },
        chart: {
            type: 'item',
            height:"320px",
            backgroundColor:'transparent'
        },
        series: [{
            name: 'Representatives',
            keys: ['name', 'y', 'color', 'label'],
            data: [
              ['The Left', 69, '#BE3075', 'DIE LINKE'],
              ['Social Democratic Party', 153, '#EB001F', 'SPD'],
              ['Alliance 90/The Greens', 67, '#64A12D', 'GRÜNE'],
              ['Free Democratic Party', 80, '#FFED00', 'FDP'],
              ['Christian Democratic Union', 200, '#000000', 'CDU'],
              ['Christian Social Union in Bavaria', 46, '#008AC5', 'CSU'],
              ['Alternative for Germany', 94, '#009EE0', 'AfD']
            ],
            center: ['50%', '50%'],
            size: '100%',
            startAngle: -100,
            endAngle: 100
        }],
        title: {
            style:{color:'transparent',fontSize:'0px',fontFamily:'cursive'},
            text: '(Click on each section for more info)'
            },
    credits: {
        enabled:false
        }
    }
    return (
    <span>
        <HighchartsReact 
            highcharts={Highcharts}
            options={options}
        />
    </span>
    )
}

export default SoftChart;
